import React from "react";
import {
  Navbar,
  Nav,
  Button,
  OverlayTrigger,
  Popover,
  NavDropdown,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const CustomNavbar = () => {
  const popoverHoverFocus = (
    <Popover id="popover-trigger-hover-focus" title="Popover bottom">
      <strong>Holy guacamole!</strong> Check this info.
    </Popover>
  );

  const popoverHoverFocus1 = (
    <Popover id="popover-trigger-hover-focus" title="Popover bottom">
      <strong>Holy guacamole!</strong> Check this info.
    </Popover>
  );

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand>
        <span className="font-weight-bold">EsaLink</span>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav" >

        <Nav className="ml-auto">
        <OverlayTrigger
          trigger={["hover", "focus"]}
          placement="bottom"
          overlay={popoverHoverFocus}
        >
          <Nav.Link>Expertise</Nav.Link>
        </OverlayTrigger>

        <OverlayTrigger
          trigger={["hover", "focus"]}
          placement="bottom"
          overlay={popoverHoverFocus1}
        >
          <Nav.Link>Solutions</Nav.Link>
        </OverlayTrigger>
        </Nav>
      

        <Nav className="ml-auto">
          <Nav.Link href="https://www.google.com">Tma connection</Nav.Link>
          <Button variant="primary">Get a Demo</Button>
          <Nav.Item className="ml-auto">
          <NavDropdown title="Dropdown" id="nav-dropdown">
            {/* Add dropdown items here */}
            <NavDropdown.Item>Action</NavDropdown.Item>
            <NavDropdown.Item>Another action</NavDropdown.Item>
          </NavDropdown>
        </Nav.Item>
        </Nav>
  

   
      </Navbar.Collapse>
    </Navbar>
  );
};

export default CustomNavbar;
